const results = [];

for (const item of $input.all()) {
  try {
    const data = item.json.output;
    const parsed = JSON.parse(data);
    results.push({ json: parsed });
  } catch (error) {
    // Eğer parse edilemezse hata vermeden geç
    results.push({ json: { error: 'Invalid JSON', original: item.json.output } });
  }
}

return results;

