const output = [];

for (const item of items) {
  const task = item.json?.task;

  if (task && task.due_date) {
    let originalDateValue = task.due_date;

    // Değerin "null" veya boş dize olmadığını kontrol et
    if (String(originalDateValue).toLowerCase() !== "null" && originalDateValue !== "") {
      try {
        // Tarihi deneme yanılma ile parse etmeye çalış (Graph API ISO 8601 ister)
        const dateObject = new Date(originalDateValue);

        // Eğer geçerli bir tarih nesnesi oluşturulabildiyse
        if (!isNaN(dateObject)) {
          // ISO 8601 formatına çevir (örn: 2025-11-21T07:55:16.000Z)
          task.due_date = dateObject.toISOString();
        } else {
          // Geçerli bir tarih değilse, due_date'i temizle veya olduğu gibi bırak
          // Not: Graph API'ye hatalı format gitmesini engellemek için null'a ayarlamak en güvenlisidir.
          task.due_date = null;
        }
      } catch (e) {
        // Dönüşüm sırasında bir hata oluşursa (çok nadirdir), due_date'i temizle
        task.due_date = null;
        console.error("Tarih dönüşüm hatası:", e);
      }
    } else {
        // Değer 'null' dizesiyse veya boşsa, null olarak ayarla (Graph API için uygun)
        task.due_date = null;
    }
  }

  // İşlenmiş öğeyi (hata olsa bile) çıktı dizisine ekle ("hatalarda devam etsin" kuralı)
  output.push(item);
}

return output;

