const items = $input.all();
const results = [];

for (const item of items) {
  // Gelen JSON içindeki 'body' alanına erişim
  const inputBody = item.json.body;
  const fileData = inputBody.file;

  // Dosya verisi var mı kontrol et
  if (fileData && fileData.data) {
    results.push({
      // JSON: AI'a göndereceğin metin (prompt) ve metadata buraya gelir
      json: {
        chatInput: inputBody.chatInput, // Kullanıcının yazdığı mesaj
        filename: fileData.filename,
        userId: inputBody.userId,
        timestamp: inputBody.timestamp
      },
      // BINARY: n8n'in dosyayı işlemesi için gereken standart format
      binary: {
        data: {
          data: fileData.data, // Gelen veri zaten Base64, direkt atıyoruz
          mimeType: fileData.mimetype,
          fileName: fileData.filename,
          fileExtension: fileData.filename.includes('.') ? fileData.filename.split('.').pop() : 'bin'
        }
      }
    });
  } else {
    // Dosya yoksa sadece JSON verisini döndür (Hata almamak için)
    results.push({
      json: {
        chatInput: inputBody.chatInput,
        userId: inputBody.userId,
        warning: "No file detected"
      }
    });
  }
}

return results;

