const items = $input.all();
const results = [];

for (const item of items) {
  // 1. Ana verideki ID'yi ve Token'ı al
  const originalId = item.json.id;
  const accessToken = item.json["input1.json->access_token"];

  // 2. Task listesini al
  const tasks = item.json.tasks || [];

  // 3. Her bir task'i işle
  for (const task of tasks) {

    // Temel objeyi oluştur (Due Date HARİÇ)
    const taskObject = {
        todoListId: originalId,
        title: task.title,
        description: task.description,
        access_token: accessToken,
        parent_subject: item.json.subject
    };

    // KONTROL: 
    // 1. task.due_date var mı?
    // 2. "null" yazısı (string) DEĞİL mi?
    // 3. Boş tırnak "" DEĞİL mi?
    if (task.due_date && task.due_date !== "null" && task.due_date !== "") {
        taskObject.due_date = task.due_date;
    }

    results.push({
      json: taskObject
    });
  }
}

return results;

